import ReactDOM from 'react-dom';
import Testbtn from './Testbtn';

class Testjanken extends React.Component{
  constructor(props){
    super(props);
    this.state={name: ""

    }
  };
    render(){
      return(
        <div>
          <span
          name= 'this.props.name'
          value='パー'
          >{this.props.name}</span>
        </div>
      );
    }
  }
export default Testjanken;
